import React from "react";
import { Link } from "react-router-dom";

const DogsList = ({ dogs }) => {
  return (
    <div className="dogs-list">
      {dogs.map((dog) => (
        <div key={dog.id} className="dog-card">
          <Link to={`/dogs/${dog.id}`}>
            <img src={dog.image} alt={dog.name} />
            <h3>{dog.name}</h3>
          </Link>
        </div>
      ))}
    </div>
  );
};

export default DogsList;
